import React from 'react';
import Loading from '../../components/loading/loading'
import { connect } from 'react-redux'
import { setCurrentLoading } from '../../redux/loading/loading.actions'
import './load-screen.css';

const LoadScreen = () => {
    return (
        <div>
            <Loading />
            <span>
                <b>Looking... Please Wait</b>
            </span>
            <button onClick={() => { setCurrentLoading({ loading: false }) }}>Cancel</button>
        </div>
    )
}

const mapDispatchToProps = dispatch => ({
    setCurrentLoading: loading => dispatch(setCurrentLoading(loading))
})

export default connect(null, mapDispatchToProps)(LoadScreen);
